//高压和VCOM开
void EPD_PowerOn(void)
{
	GPIO_SetBits(VNEGGVEE_CTR_PORT, VNEGGVEE_CTR);  //pa1
	Delay(0xf);
	GPIO_SetBits(VPOS15_CTR_PORT, VPOS15_CTR);      //pa2
	Delay(0xf);
	GPIO_SetBits(GVDD22_CTR_PORT, GVDD22_CTR);      //pa3
	Delay(0xf);
	
	GPIO_SetBits(VCOM_CTR_PORT, VCOM_CTR);					//VCOM = -V
	Delay(0xff);
	
}

//xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx
//高压和VCOM关  
void EPD_PowerOff(void)
{
	GPIO_ResetBits(VCOM_CTR_PORT, VCOM_CTR);				//VCOM = 0
	Delay(0xff);
	
	GPIO_ResetBits(GVDD22_CTR_PORT, GVDD22_CTR);
	Delay(0xf);
	GPIO_ResetBits(VPOS15_CTR_PORT, VPOS15_CTR);
	Delay(0xf);
	GPIO_ResetBits(VNEGGVEE_CTR_PORT, VNEGGVEE_CTR);
	Delay(0xff);
}


//xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx
//xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx
//xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx
//xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx
//电子纸IO口初始化
void EPD_Init(void)
{
	GPIO_ResetBits(EPD_SHR_PORT, EPD_SHR);               	//Shift direction source driver	  
	GPIO_SetBits(EPD_GMODE1_PORT, EPD_GMODE1);				//one pulse mode	
	GPIO_SetBits(EPD_GMODE2_PORT, EPD_GMODE2);				//one pulse mode
	GPIO_SetBits(EPD_XRL_PORT, EPD_XRL);               		//Shift direction gate driver
	//GPIO_ResetBits(EPD_XRL_PORT, EPD_XRL);               		//Shift direction gate driver
	GPIO_ResetBits(EPD_XCE1_PORT, EPD_XCE1);       			//EPD正像	
	GPIO_ResetBits(EPD_XCE2_PORT, EPD_XCE2);       			//EPD正像
	


	EPD_PowerOff();

	EPD_LE_L;
	EPD_CL_L;
	EPD_OE_L;
	EPD_SPH_H;
	EPD_XSPV_H;
	EPD_CLK_L;
}
//xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx
//EPD开始时序
void EPD_Start_Scan(void)
{
	   
	EPD_XSPV_H;                                             //XSPV先高

	loop = 2;                                       		//DCLK跑2个时钟
	while(loop--)                            
	{
		EPD_CLK_L;
		Delay(0xf);	
		EPD_CLK_H;
		Delay(0xf);
	}
 
	EPD_XSPV_L;                                             //XSPV再低

	loop = 2;
	while(loop--)
	{
		EPD_CLK_L;                    						//DCLK跑2个时钟
		Delay(0xf);
		EPD_CLK_H;
		Delay(0xf);
	}

	EPD_XSPV_H;                                             //XSPV  变高
	loop = 2;
	while(loop--)
	{
		EPD_CLK_L;
		Delay(0xf);
		EPD_CLK_H;
		Delay(0xf);
	}
}


//xxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxxx
//行扫描
void EPD_Send_Row_Data(u8 *pArray )      					//  送数据，
{

	EPD_LE_H;                                              	//LE 先低
	EPD_CL_L;
	EPD_CL_H;
	EPD_CL_L;
	EPD_CL_H;
	
	EPD_LE_L;  												//LE 高
	EPD_CL_L;
	EPD_CL_H;
	EPD_CL_L;
	EPD_CL_H;
	
	EPD_OE_H;                                              	//OE 先高
	EPD_CL_L;
	EPD_CL_H;
	EPD_CL_L;
	EPD_CL_H;

	EPD_SPH_L;                                              //STL 先低，	                                           
	
	old_data = (uint16_t)(EPD_DB_PORT->ODR);
	old_data &= 0xFF00;
	for(column= 0; column < 200; column++)          		// 写一行数据， 
	{
		new_data = old_data  | (u16)pArray[column];
		(EPD_DB_PORT->ODR) = new_data;

		EPD_CL_L;
		EPD_CL_H;
	}

	EPD_SPH_H;                                             	//STL 高
 
	EPD_CL_L;
	EPD_CL_H;
	EPD_CL_L;
	EPD_CL_H;

  	EPD_CLK_L;                                               //DCLK  变低
	EPD_OE_L;                                                //OE  变低
	EPD_CL_L;
	EPD_CL_H;
	EPD_CL_L;
	EPD_CL_H;
	
	EPD_CLK_H;                                               //DCLK  变高( DCLK 一个时钟)
}

















